description.text:
Be come the Jedi you were destined to be! Manufacture your lightsaber and take your place in the battle between the Jedi and Sith!<br />
This is a complete user assembled model of one of the greatest allies a Jedi has!<br />
&quot;Your lightsaber is your life&quot;

Revised .stl file to correct issue noted by BSchuler.  The revised OpenSCAD code is below:
//Bearing Dimensions<br />
//Basic Inputs<br />
t=8; //thickness of bearing<br />
OR=30; //Outer Radius of outer bearing race<br />
IR=18; //Inner Radius of inner bearing race<br />
PCT=.8; //Percent of t or d used to determine ball size
//Derived Inputs<br />
d=OR-IR; //difference between Outer &amp; Inner Radius of races<br />
echo(&quot;bearing thickness=&quot;,t);<br />
echo(&quot;Outer-Inner Bearing Radius=&quot;,d);<br />
BR=(PCT/2)<em >min(t,d); //Ball bearing radius<br />
echo(&quot;BR=&quot;,BR);<br />
BC=(OR+IR)/2;  //Radius of ball bearing circle<br />
GP=BR/3;  //Half of Gap between inner and outer race, set at 1/3 ball radius<br />
M=1.01; //Multiplier to make space between races larger than ball bearing<br />
N=round(((2</em>BC<em >PI)/(2</em>BR))+.5)-1;  //Number of balls in bearing<br />
echo(&quot;N=&quot;,N);
$fn=50; //Increase to 100 or greater to improve smoothness of bearings &amp; races but this significantly increases time to render
//difference forms races of bearing<br />
difference(){<br />
//disk forming OD of bearing<br />
cylinder(t,OR,OR,center=true);<br />
//remove ring to form Id of outer race and Od of inner race<br />
rotate_extrude(convexity=20)translate([BC,0,0])circle(M<em >BR,center=true);<br />
//remove disk to form ID of inner race<br />
cylinder(t,IR,IR,center=true);<br />
//opening between inner and outer race<br />
translate([0,0,0])difference(){<br />
cylinder(t+2,BC+GP,BC+GP,center=true);<br />
cylinder(t+2,BC-GP,BC-GP,center=true);}}<br />
//adds ball bearings within race<br />
for (i=[1:N])rotate(i</em>360/N*[0,0,1])translate([BC,0,0])sphere(BR,center=true);
